import React from 'react'
import { Row, Col } from 'antd';
import Link from 'next/link'
import { LikeOutlined, StarOutlined } from '@ant-design/icons';
import { List} from 'antd';


function RenderItems(props) {
    console.log(props);
    
    const IconText = ({ icon, text }) => (
        <span>
            {React.createElement(icon, { style: { marginRight: 8 } })}
            {text}
        </span>
    );
    return (
        <Row key={props.id} justify="center">
            <Col span={8}>
                <List.Item
                    style={{ borderBottom: '1px solid', borderColor: '#e2dedc' }}
                    actions={[
                        <IconText icon={StarOutlined} text={props.vote} key="list-vertical-star-o" />,
                        <IconText icon={LikeOutlined} text={props.like} key="list-vertical-like-o" />,
                        // <IconText icon={MessageOutlined} text="2" key="list-vertical-message" />,
                    ]}
                    extra={
                        <Link href={`/detail/${props.id}`}>
                            <a>
                                <img
                                    width={172}
                                    alt="logo"
                                    src={props.image}
                                />
                            </a>
                        </Link>
                    }
                >
                    <Link href={`/detail/${props.id}`}>
                        <a>
                            <List.Item.Meta
                                title={props.name}
                                description={props.address}
                            />
                        </a>
                    </Link>
                    {props.description}
                </List.Item>
            </Col>
        </Row>
    )
}

export default RenderItems
